  selector: 'app-purchase-summary-dialog',
  templateUrl: 'purchase-summary-dialog.component.html',
})
export class PurchaseSummaryDialogComponent {
  constructor(@Inject(MAT_DIALOG_DATA) public data: any) {}
}
